import pandas as pd
import json

# 读取原始的数据集
filepath_StudentsConsumption = '../../education_data/7_consumption.csv'

filepath_StudentsInfo = '../../education_data/2_student_info.csv'

##############################################################################
# 完成贫困生发现的部分
# 展示形式为散点图的形式，统计每个学生的消费总额，统计学生消费次数和平均消费金额

# 数据形式[学生id，消费总额，消费次数，平均消费金额]

def discover_poverty_students():
    data_consumption = pd.read_csv(filepath_StudentsConsumption)
    consumption_groupby_stdID = data_consumption.groupby(['bf_StudentID']).count().reset_index()
    student_consumption_array = []
    for i in range(consumption_groupby_stdID.shape[0]):
        print('正在计算第', i, '行数据')
        student_consumption_array_piece = []
        the_student_ID = consumption_groupby_stdID['bf_StudentID'].iloc[i]
        student_consumption_array_piece.append(the_student_ID)
        # 统计学生的消费总额
        student_consumption_all = data_consumption.drop(data_consumption[data_consumption['bf_StudentID'] != the_student_ID].index)
        student_consumption_total = 0
        for j in range(student_consumption_all.shape[0]):
            student_consumption_total += student_consumption_all['MonDeal'].iloc[j]
        student_consumption_total = 0 - int(student_consumption_total)
        student_consumption_array_piece.append(student_consumption_total)
        # 学生消费次数
        student_consumption_time = consumption_groupby_stdID['DealTime'].iloc[i]
        student_consumption_array_piece.append(student_consumption_time)
        # 学生平均消费金额
        student_consumption_average = round(student_consumption_total / student_consumption_time, 2)
        student_consumption_array_piece.append(student_consumption_average)
        # 每个学生的消费情况
        student_consumption_array.append(student_consumption_array_piece)
    print(student_consumption_array)

